// 等页面加载完成后执行
document.addEventListener('DOMContentLoaded', function() {
    // 初始化图表
    initCharts();

    // 渲染书籍列表
    renderBooks(booksData);

    // 设置搜索功能
    setupSearch();
});

// 初始化图表
function initCharts() {
    // 数据预处理
    const pubCount = {},
        discountGroup = {},
        authorMap = {},
        priceData = [];

    booksData.forEach((book) => {
        // 出版社统计
        const pub = book["出版社"] || "未知";
        pubCount[pub] = (pubCount[pub] || 0) + 1;

        // 价格数据收集
        const price = parseFloat(book["价格"]);
        if (!isNaN(price)) priceData.push(price);

        // 折扣分组统计
        const discount = parseFloat(book["折扣比例"]);
        if (!isNaN(discount)) {
            const group = `${(Math.floor(discount * 10) / 10).toFixed(1)}-${(
                Math.floor(discount * 10) / 10 +
                0.1
            ).toFixed(1)}`;
            discountGroup[group] = (discountGroup[group] || 0) + 1;
        }

        // 作者处理
        const author = book["作者"]?.split(/[，,、/\\|\s]/)[0] || "未知";
        authorMap[author] = (authorMap[author] || 0) + 1;
    });

    // 出版社柱状图
    const pubChart = echarts.init(document.getElementById('pubChart'));
    const sortedPub = Object.entries(pubCount)
        .sort((a, b) => b[1] - a[1])
        .slice(0, 10);
    pubChart.setOption({
        title: { text: "Top10 出版社", left: "center" },
        tooltip: { trigger: "axis" },
        xAxis: {
            type: "category",
            data: sortedPub.map((i) => i[0]),
            axisLabel: { rotate: 30, fontSize: 12 },
        },
        yAxis: { type: "value" },
        series: [
            {
                type: "bar",
                data: sortedPub.map((i) => i[1]),
                itemStyle: { color: "#3498db" },
            },
        ],
    });

    // 价格直方图
    const priceChart = echarts.init(document.getElementById('priceChart'));
    const priceBins = [
        ...new Set(priceData.map((p) => Math.floor(p / 10) * 10)),
    ].sort((a, b) => a - b);
    priceChart.setOption({
        title: { text: "价格区间分布", left: "center" },
        tooltip: { trigger: "axis" },
        xAxis: {
            type: "category",
            data: priceBins.map((p) => `${p}-${p + 9}`),
            axisLabel: { rotate: 45 },
        },
        yAxis: { type: "value" },
        series: [
            {
                type: "bar",
                data: priceBins.map(
                    (bin) => priceData.filter((p) => p >= bin && p < bin + 10).length
                ),
                itemStyle: { color: "#2ecc71" },
            },
        ],
    });

    // 折扣饼图
    const discountChart = echarts.init(document.getElementById('discountGroupChart'));
    const sortedDiscount = Object.entries(discountGroup).sort((a, b) =>
        a[0].localeCompare(b[0])
    );
    discountChart.setOption({
        title: { text: "折扣比例分布", left: "center" },
        tooltip: { trigger: "item", formatter: "{b}: {c} ({d}%)" },
        series: [
            {
                type: "pie",
                radius: ["40%", "70%"],
                data: sortedDiscount.map(([name, value]) => ({ name, value })),
                itemStyle: {
                    borderRadius: 5,
                    borderColor: "#fff",
                    borderWidth: 2,
                },
                emphasis: { label: { show: true, fontSize: 16 } },
            },
        ],
        color: ["#3498db", "#2ecc71", "#e74c3c", "#9b59b6", "#f1c40f"],
    });

    // 生成词云图时过滤掉英文单词、方括号及其内容、以及“主编”和“著”
    const wordEntries = Object.entries(authorMap)
        .sort((a, b) => b[1] - a[1])
        .map(([word, count]) => {
            // 使用综合正则表达式过滤掉不想要的内容
            const cleanedWord = word
                .replace(/\[.*?\]/g, '') // 过滤掉方括号及其内容
                .replace(/\(.*?\)/g, '') // 过滤掉括号及其内容
                .replace(/(主编|著)/g, '') // 过滤掉“主编”和“著”
                .replace(/[A-Za-z]+/g, ''); // 过滤掉英文单词
            return [cleanedWord, count];
        })
        .filter(([word]) => word.trim() !== '') // 过滤掉空字符串
        .slice(0, 100);

    WordCloud(document.getElementById("wordcloud"), {
        list: wordEntries,
        gridSize: 12,
        weightFactor: 5,
        fontFamily: "Microsoft YaHei",
        color: () => `hsl(${Math.random() * 360}, 70%, 50%)`,
        backgroundColor: "#f8f9fa",
        rotateRatio: 0.3,
    });
    // 窗口大小改变时重新调整图表大小
    window.addEventListener('resize', function() {
        pubChart.resize();
        priceChart.resize();
        discountChart.resize();
    });
}

// 渲染书籍列表
function renderBooks(books) {
    const booksContainer = document.querySelector('.books-container');
    booksContainer.innerHTML = '';

    books.forEach(book => {
        const bookCard = document.createElement('div');
        bookCard.className = 'book-card';
        bookCard.innerHTML = `
            <div class="book-info">
                <div class="book-title">${book.书名}</div>
                <div class="book-author">${book.作者}</div>
                <div class="book-price">¥${book.价格}</div>
                <div class="book-discount">${book.折扣比例 > 0 ? `折扣: ${((1-book.折扣比例) * 10).toFixed(1)}折` : '无折扣'}</div>
                <a href="${book.图书链接}" target="_blank" class="book-link">访问图书链接</a>
            </div>
        `;
        booksContainer.appendChild(bookCard);
    });
}
function setupSearch() {
    document.getElementById('searchBtn').addEventListener('click', function() {
        const searchTerm = document.getElementById('searchInput').value.trim();
        if (searchTerm === '') {
            renderBooks(booksData);
            updateCharts(booksData);
            return;
        }

        const filteredBooks = booksData.filter(book => {
            const title = book.书名?.toLowerCase?.() || '';
            const author = book.作者?.toLowerCase?.() || '';
            return title.includes(searchTerm.toLowerCase()) || author.includes(searchTerm.toLowerCase());
        });

        renderBooks(filteredBooks);
        updateCharts(filteredBooks);
    });
}
// 更新图表
function updateCharts(books) {
    // 数据预处理
    const pubCount = {},
        discountGroup = {},
        authorMap = {},
        priceData = [];

    books.forEach((book) => {
        // 出版社统计
        const pub = book["出版社"] || "未知";
        pubCount[pub] = (pubCount[pub] || 0) + 1;

        // 价格数据收集
        const price = parseFloat(book["价格"]);
        if (!isNaN(price)) priceData.push(price);

        // 折扣分组统计
        const discount = parseFloat(book["折扣比例"]);
        if (!isNaN(discount)) {
            const group = `${(Math.floor(discount * 10) / 10).toFixed(1)}-${(
                Math.floor(discount * 10) / 10 +
                0.1
            ).toFixed(1)}`;
            discountGroup[group] = (discountGroup[group] || 0) + 1;
        }

        // 作者处理
        const author = book["作者"]?.split(/[，,、/\\|\s]/)[0] || "未知";
        authorMap[author] = (authorMap[author] || 0) + 1;
    });

    // 更新出版社柱状图
    const pubChart = echarts.getInstanceByDom(document.getElementById("pubChart"));
    if (pubChart) {
        const sortedPub = Object.entries(pubCount)
            .sort((a, b) => b[1] - a[1])
            .slice(0, 10);
        pubChart.setOption({
            xAxis: {
                data: sortedPub.map((i) => i[0]),
            },
            series: [{
                data: sortedPub.map((i) => i[1]),
            }]
        });
    }

    // 更新价格直方图
    const priceChart = echarts.getInstanceByDom(document.getElementById("priceChart"));
    if (priceChart) {
        const priceBins = [
            ...new Set(priceData.map((p) => Math.floor(p / 10) * 10)),
        ].sort((a, b) => a - b);
        priceChart.setOption({
            xAxis: {
                data: priceBins.map((p) => `${p}-${p + 9}`),
            },
            series: [{
                data: priceBins.map(
                    (bin) => priceData.filter((p) => p >= bin && p < bin + 10).length
                ),
            }]
        });
    }

    // 更新折扣饼图
    const discountChart = echarts.getInstanceByDom(document.getElementById("discountGroupChart"));
    if (discountChart) {
        const sortedDiscount = Object.entries(discountGroup).sort((a, b) =>
            a[0].localeCompare(b[0])
        );
        discountChart.setOption({
            series: [{
                data: sortedDiscount.map(([name, value]) => ({ name, value })),
            }]
        });
    }

    // 更新词云图
    const wordcloudElement = document.getElementById("wordcloud");
    const wordEntries = Object.entries(authorMap)
        .sort((a, b) => b[1] - a[1])
        .map(([word, count]) => {
            // 使用综合正则表达式过滤掉不想要的内容
            const cleanedWord = word
                .replace(/\[.*?\]/g, '') // 过滤掉方括号及其内容
                .replace(/\(.*?\)/g, '') // 过滤掉括号及其内容
                .replace(/(主编|著)/g, '') // 过滤掉“主编”和“著”
                .replace(/[A-Za-z]+/g, ''); // 过滤掉英文单词
            return [cleanedWord, count];
        })
        .filter(([word]) => word.trim() !== '') // 过滤掉空字符串
        .slice(0, 100);
    if (wordEntries.length > 0) {
        WordCloud(wordcloudElement, {
            list: wordEntries,
            gridSize: 12,
            weightFactor: 5,
            fontFamily: "Microsoft YaHei",
            color: () => `hsl(${Math.random() * 360}, 70%, 50%)`,
            backgroundColor: "#f8f9fa",
            rotateRatio: 0.3,
        });
    }
}